import Card from "./shared/Card"
function FeedbackItems ({item}){

    return(
        <Card>
        <div className="card-body "> {item.text} 
        <span className=" position-absolute top-0 start-0 translate-middle badge rounded-pill bg-secondary text-bg-white">
              {item.rating}
        </span>
       
        </div>
            
        </Card>
    )
}
export default FeedbackItems
